import { Tabs } from 'antd';
const { TabPane } = Tabs;

const BgAtas = () => (
  <div className="card-container" style={{marginLeft:"56px",margin:"10px"}}>
    <Tabs type="card">
      <TabPane tab="General Report" key="1">
        <p>Content of Tab Pane 1</p>
      </TabPane>

    </Tabs>
  </div>
);

export default BgAtas;
